import { all } from 'redux-saga/effects';

import AuthSaga from './auth/saga';
import AdminSaga from './admin/saga';
import HomeCategorySaga from './homeCategory/saga';
import QBankMainCategory from './qBankMainCategory/saga';
import DashboardCategory from './DashboardCategory/saga';
import Coupon from './Coupon/saga';
import Student from './Student/saga';
import Testimonials from './Testimonials/saga';
export default function* rootSaga() {
    yield all([
        AuthSaga(),
        AdminSaga(),
        HomeCategorySaga(),
        QBankMainCategory(),
        DashboardCategory(),
        Coupon(),
        Student(),
        Testimonials()
    ]);
}
